import React from 'react'
import App1 from './App1';
import App2 from './App2';
import "./Globle.css"
import App3 from './App3';

function App () {
  return (
   <>
   <App3 data="hello" num={72346} data1={true} null={null}/>
   <div id='nav'>
    
    <App1/>
     <App2/>
    </div>
    </>
  )
}

export default App
